var {width, height } = window;
width *= 0.5;

export default () => {
    const element = <Canvas  id="canvas"
                             yPos="100"
                             xPOse="200" />;
ReactDOM.render(
    element,
  document.getElementById('root')
);

    setTimeout(() => new Game().start(), 1500);

}

const Canvas = styled.canvas`
    position:relative;
    top: ${width};
    left: ${height};
`;
